CREATE DEFINER=`root`@`localhost` PROCEDURE `diferenciasPlanes`(IN years int , IN semester int, IN escuela CHAR(100))
BEGIN
 /*plan antiguo*/
 declare seme INT;
 declare esc INT;
 SET @seme = (SELECT semestre -1 FROM semestre se WHERE ano=years AND semestre=semester);
 SET @esc= (SELECT idescuela FROM escuela WHERE descripcion =escuela );
 if(@seme = 0) 
 then SET @seme = (SELECT se.idSemestre -1 FROM semestre se WHERE ano=years AND semestre=semester);
 ELSE  SET @seme = (SELECT se.idSemestre -1 FROM semestre se WHERE ano=years AND semestre=semester);
 END IF;
 
 

CREATE TABLE IF NOT EXISTS PLAN1 AS (SELECT c.nombre AS nombre,
    codDce_curso AS sap,
    det.sicat AS sicat,
    det.ciclo AS ciclo,
    det.codDce_escuela AS escuela,
    det.creditos AS creditos,
    det.h_teo AS h_teoria,
    det.h_lab h_labo,
    det.h_pract AS h_pract,
    det.estado FROM
    det_curso_esc det,
    curso c
WHERE
    c.index_curso = det.index_curso
    AND codDce_escuela=@esc
	AND codDce_sem = @seme
        );

 /*plan nuevo*/
CREATE TABLE IF NOT EXISTS PLAN2 AS (SELECT c.nombre AS nombre,
