CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_HORASINIFINEXCEL`(
	IN _ESCUELA VARCHAR(10)
)
BEGIN

CREATE TABLE IF NOT EXISTS HORARIO_DOCENTE AS (
SELECT 	EXC.PROFESOR,
		SUBSTR(REPLACE(REPLACE(EXC.LUNES, '-', ''), ':', ''), 1, 4) * 1 AS LUNES_INI,
        SUBSTR(REPLACE(REPLACE(EXC.LUNES, '-', ''), ':', '') FROM 5) * 1 AS LUNES_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.MARTES, '-', ''), ':', ''), 1, 4) * 1 AS MARTES_INI,
        SUBSTR(REPLACE(REPLACE(EXC.MARTES, '-', ''), ':', '') FROM 5) * 1 AS MARTES_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.MIERCOLES, '-', ''), ':', ''), 1, 4) * 1 AS MIERCOLES_INI,
        SUBSTR(REPLACE(REPLACE(EXC.MIERCOLES, '-', ''), ':', '') FROM 5) * 1 AS MIERCOLES_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.JUEVES, '-', ''), ':', ''), 1, 4) * 1 AS JUEVES_INI,
        SUBSTR(REPLACE(REPLACE(EXC.JUEVES, '-', ''), ':', '') FROM 5) * 1 AS JUEVES_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.VIERNES, '-', ''), ':', ''), 1, 4) * 1 AS VIERNES_INI,
        SUBSTR(REPLACE(REPLACE(EXC.VIERNES, '-', ''), ':', '') FROM 5) * 1 AS VIERNES_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.SABADO, '-', ''), ':', ''), 1, 4) * 1 AS SABADO_INI,
        SUBSTR(REPLACE(REPLACE(EXC.SABADO, '-', ''), ':', '') FROM 5) * 1 AS SABADO_FIN,
        SUBSTR(REPLACE(REPLACE(EXC.DOMINGO, '-', ''), ':', ''), 1, 4) * 1 AS DOMINGO_INI,
        SUBSTR(REPLACE(REPLACE(EXC.DOMINGO, '-', ''), ':', '') FROM 5) * 1 AS DOMINGO_FIN,
        CURSO
	FROM HORARIO_EXCEL AS EXC WHERE ESCUELA LIKE concat('%', _ESCUELA,'%')
);

SELECT * FROM HORARIO_DOCENTE;

DROP TABLE IF EXISTS HORARIO_DOCENTE;

END ;;
DELIMITER ;
